import React from 'react'

const TodoList = ({todo,setTodo}) => {
    const deleteTodo = ({id})=>{
        setTodo(todo.filter((todo)=>todo.id != id));
    };
    return (
        <div>
            {todo.map((todolist)=>(
            <li className='list-item' key={todolist.id}>
                <input type='text' className='input-list' value={todolist.title} onChange={(event)=>{event.preventDefault()}} />
            <div>
                <button className="complteButton">
                    Compleate
                </button>
                <button className="editButton">
                    Edit
                </button>
                <button className="deleteButton" onClick={deleteTodo(todo)}>
                    Delete
                </button>
            </div>
            </li>
        ))}
        </div>
    )
}

export default TodoList
